import axios from "axios";
import React, { useEffect, useState } from "react";

import NewMusic from "./components/NewMusic";

function App() {
  const [musics, setMusics] = useState([]);
  console.log(musics);
  useEffect(() => {
    axios
      .get("localhost:5000")
      .then((res) => console.log(res.data))
      .catch((err) => console.error(err));
  }, []);
  return (
    <div>
      <NewMusic />
    </div>
  );
}

export default App;
